## Explica√ß√£o dos Logs Mockados

Esses logs representariam eventos reais do sistema em produ√ß√£o:

### 1. **"Sync completed successfully"** (Sincroniza√ß√£o conclu√≠da)
- **O que seria**: Quando o PGlite local sincroniza dados com o servidor
- **Dados reais**: N√∫mero de registros sincronizados, tempo decorrido, dire√ß√£o (upload/download)
- **Exemplo real**: `[2025-05-26 14:32:01] INFO: Sync completed - 47 records uploaded, 12 downloaded in 245ms`

### 2. **"Backup created"** (Backup criado)
- **O que seria**: Sistema de backup incremental salvando snapshot do banco
- **Dados reais**: Tamanho do backup, localiza√ß√£o, tipo (completo/incremental)
- **Exemplo real**: `[2025-05-26 14:31:45] SUCCESS: Incremental backup created - 2.3MB saved to IndexedDB`

### 3. **"High memory usage detected"** (Uso alto de mem√≥ria)
- **O que seria**: Monitor detectando consumo excessivo de RAM
- **Dados reais**: Percentual usado, limite, processo causador
- **Exemplo real**: `[2025-05-26 14:30:22] WARN: Memory usage at 85% (680MB/800MB) - Consider clearing cache`

### 4. **"Cache cleared"** (Cache limpo)
- **O que seria**: Limpeza autom√°tica ou manual do cache multi-camadas
- **Dados reais**: Quantidade liberada, camadas afetadas
- **Exemplo real**: `[2025-05-26 14:29:15] INFO: Cache cleared - 45MB freed from memory, 120MB from IndexedDB`

### 5. **"Connection timeout"** (Timeout de conex√£o)
- **O que seria**: WebSocket perdendo conex√£o com servidor
- **Dados reais**: Endpoint, tempo de tentativa, c√≥digo de erro
- **Exemplo real**: `[2025-05-26 14:28:03] ERROR: WebSocket timeout after 30s - wss://api.example.com/sync - Retrying...`

## Como Implementar Logs Reais

```typescript
// Sistema de logging real
class Logger {
  private logs: LogEntry[] = [];

  log(level: 'INFO' | 'SUCCESS' | 'WARN' | 'ERROR', message: string, details?: any) {
    const entry = {
      timestamp: new Date(),
      level,
      message,
      details
    };

    // Salvar no PGlite
    this.saveToDB(entry);

    // Emitir evento para UI
    this.emit('log', entry);
  }
}

// Uso real no sync
async syncData() {
  logger.log('INFO', 'Starting sync...', { direction: 'bidirectional' });

  try {
    const result = await syncEngine.sync();
    logger.log('SUCCESS', `Sync completed - ${result.uploaded} up, ${result.downloaded} down`, result);
  } catch (error) {
    logger.log('ERROR', 'Sync failed', { error: error.message, stack: error.stack });
  }
}
```

Esses logs seriam essenciais para debugging, auditoria e monitoramento da sa√∫de do sistema em produ√ß√£o.
